column8:
LGV32の革仕様レザーブラウンとレザーブラックには装着できません。予めご了承ください。<br><br><table width="300" border="0" cellpadding="0" cellspacing="1" bgcolor="#FF9933">
<tr><td><strong><font color="#FFFFFF">★商品説明</font></strong></td>
</tr><tr><td><table width="100%" border="0" cellspacing="7" cellpadding="0" bgcolor="#FFFFFF">
<tr><td width="20%" height="48">☆素材の安定した確保の為、写真とは形状（カメラ穴・サイド穴等）が異なる素材も使用しております。<br>

    <br>☆側面への印刷はありません。<br>
    <br>☆ノンパッケージの商品となります。<br>
    <br>
    ■ソフトケースの特徴<br>
      ☆柔らかく、耐久性のあるＴＰＵケースです。<br>
    <br>☆ハードケースで問題になっているケースの割れやヒビは発生しません。<br>
    <br>☆ＴＰＵは使用している間に黄変してきます。また、ジーパンなどに入れると色移りする場合がございます。ご了承のうえ、ご購入下さい。<br>
    <br>☆手触りのよい、ＴＰＵ（柔らかいプラスチック）です。 ＴＰＵは、堅さをコントロール出来る素材です。シリコンよりは堅いですが、軟性のある商品です。<br>
    <br>※カバー装着のまま卓上ホルダ(充電クレイドル等)は使用は出来ません。<br>
      USBを使用する場合はカバーをはずさずに使用できます。<br>
    <br>※決済確認後、３営業日以内の発送になります。<br>
    <br></td>
</tr></table></td></tr></table><br><br>
（配送について）<br>
<br> 
●メール便（全国一律194円）<br>
・日本郵便のゆうパケットになります。<br>
・ポスト投函の配送方法です。<br>
・代引不可（メール便で代引をご指定された場合は自動的にコンビニ後払いに変更させて頂きます。決済手数料は200円）<br>
・配送の日時指定不可<br>
・配送中の紛失・破損の保証はありません。<br>
・ロッカー受取不可<br>
<br>
●宅配便（本州500円、沖縄・北海道1,000円）<br>
・ゆうパック、ヤマト運輸、佐川急便<br>
・代引可<br>
・配送の日時指定可<br>
・配送保証あり<br>
<br>
●ロッカー受取（本州500円、沖縄・北海道1,000円）<br> 
・宅配便のみ可<br>
・代引不可<br><!-- カートカスタマイズ用CSS　ここから -->
